function main() {
  var canvas = document.getElementById('webgl-canvas');
  var gl = canvas.getContext('webgl');
  if (!gl) {
    return;
  }

  var vertexShader = createShader(gl, gl.VERTEX_SHADER, document.getElementById('3d-vertex-shader').text);
  var fragmentShader = createShader(gl, gl.FRAGMENT_SHADER, document.getElementById('3d-fragment-shader').text);
  var program = createProgram(gl, vertexShader, fragmentShader);

  var positionLocation = gl.getAttribLocation(program, 'a_position');
  var colorLocation = gl.getAttribLocation(program, 'a_color');

  var matrixLocation = gl.getUniformLocation(program, 'u_matrix');

  var positionBuffer = gl.createBuffer();
  gl.bindBuffer(gl.ARRAY_BUFFER, positionBuffer);
  setGeometry(gl);

  var colorBuffer = gl.createBuffer();
  gl.bindBuffer(gl.ARRAY_BUFFER, colorBuffer);
  setColors(gl);

  drawScene();

  function drawScene() {
    gl.viewport(0, 0, gl.canvas.width, gl.canvas.height);
    gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
    gl.enable(gl.CULL_FACE);
    gl.enable(gl.DEPTH_TEST);

    gl.useProgram(program);

    gl.enableVertexAttribArray(positionLocation);
    gl.bindBuffer(gl.ARRAY_BUFFER, positionBuffer);
    gl.vertexAttribPointer(
      positionLocation,
      3,
      gl.FLOAT,
      false,
      0,
      0,
    );

    gl.enableVertexAttribArray(colorLocation);
    gl.bindBuffer(gl.ARRAY_BUFFER, colorBuffer);
    gl.vertexAttribPointer(
      colorLocation,
      3,
      gl.UNSIGNED_BYTE,
      true,
      0,
      0,
    );

    var matrix = m4.projection(gl.canvas.clientWidth, gl.canvas.clientHeight, 400);
    matrix = m4.translate(matrix, 45, 150, 0);
    matrix = m4.xRotate(matrix, (40 * Math.PI) / 180);
    matrix = m4.yRotate(matrix, (25 * Math.PI) / 180);
    matrix = m4.zRotate(matrix, (325 * Math.PI) / 180);

    gl.uniformMatrix4fv(matrixLocation, false, matrix);

    gl.drawArrays(gl.TRIANGLES, 0, 16 * 6);
  }
}

var i;
var maxEle;
var minEle;
var maxLat;
var minLat;
var maxLon;
var minLon;
for (i = 0; i < bikeWaypoints.length; i++) {
  if (i === 0) {
    maxEle = parseFloat(bikeWaypoints[i].ele);
    minEle = parseFloat(bikeWaypoints[i].ele);
    maxLat = parseFloat(bikeWaypoints[i].lat);
    minLat = parseFloat(bikeWaypoints[i].lat);
    maxLon = parseFloat(bikeWaypoints[i].lon);
    minLon = parseFloat(bikeWaypoints[i].lon);
  } else {
    if (parseFloat(bikeWaypoints[i].ele) > maxEle) {
      maxEle = parseFloat(bikeWaypoints[i].ele);
    }
    if (parseFloat(bikeWaypoints[i].ele) < minEle) {
      minEle = parseFloat(bikeWaypoints[i].ele);
    }
    if (parseFloat(bikeWaypoints[i].lat) > maxLat) {
      maxLat = parseFloat(bikeWaypoints[i].lat);
    }
    if (parseFloat(bikeWaypoints[i].lat) < minLat) {
      minLat = parseFloat(bikeWaypoints[i].lat);
    }
    if (parseFloat(bikeWaypoints[i].lon) > maxLon) {
      maxLon = parseFloat(bikeWaypoints[i].lon);
    }
    if (parseFloat(bikeWaypoints[i].lon) < minLon) {
      minLon = parseFloat(bikeWaypoints[i].lon);
    }
  }
}

